SELECT DISTINCT ?substation2 ?substation2Name ?line ?lineName WHERE {
  # Substation STAVANGER
  BIND(urn:uuid:f1769664-9aeb-11e5-91da-b8763fd99c5f AS ?substation1) .

  # Find lines connected to STAVANGER
  ?line a cim:Line ;
        cimex:connectedThroughPart ?substation1, ?substation2 ;
        cim:IdentifiedObject.name ?lineName .

  # Ensure the connected substation is different from STAVANGER
  ?substation2 a cim:Substation ;
               cim:IdentifiedObject.name ?substation2Name .
  FILTER(?substation1 != ?substation2)
}

